import http from "../http-common";

class UploadFilesService {
  upload(file, onUploadProgress) {
    let formData = new FormData();

    formData.append("uploadFile", file);

    return http.post("/uploadAndPrepare/Passport_Page", formData, {
      headers: {
        "Content-Type": "multipart/form-data",
      },
      onUploadProgress,
    });
  }

  executeRules(transactionalId, onUploadProgress) {
    let formData = new FormData();



    return http.post("/executeRules/" + transactionalId + "bc8e2b0a-4e02-41f3-bbd1-e0cdf09e58c7/dan/dan/Documents,NormalOCR,GenerateText,PassportFields/xml", formData, {
      headers: {
        "Content-Type": "multipart/form-data",
      },
      onUploadProgress,
    });
  }

  getFiles() {
    return http.get("/files");
  }
}

export default new UploadFilesService();
